import React from "react";
import PropTypes from "prop-types";
import { Button } from "antd";
const DoneFail = ({ week, day }) => {
  return (
    <div>
      {week}
      {day}
    </div>
  );
};

DoneFail.propTypes = {
  week: PropTypes.object.isRequired,
  day: PropTypes.object.isRequired,
};

export default DoneFail;
